tables.table_schema:
CREATE TABLE transactions (
  transaction_id INT PRIMARY KEY,
  delivery_service_id INT,
  payment_amount DECIMAL(10, 2),
  transaction_date DATE
);

CREATE TABLE revenue_streams (
  revenue_stream_id INT PRIMARY KEY,
  delivery_service_id INT,
  revenue_amount DECIMAL(10, 2),
  revenue_date DATE
);

CREATE TABLE transactions (
    transaction_id INT PRIMARY KEY,
    user_id INT,
    amount DECIMAL(10, 2),
    transaction_date DATE
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    user_name VARCHAR(50),
    email VARCHAR(50),
    registration_date DATE
);

CREATE TABLE revenue (
    transaction_id INT PRIMARY KEY,
    revenue_amount DECIMAL(10, 2),
    delivery_provider VARCHAR(50),
    revenue_date DATE
);

CREATE TABLE customers (
    customer_id INT PRIMARY KEY,
    customer_name VARCHAR(50),
    customer_email VARCHAR(100),
    customer_phone_number VARCHAR(15)
);

CREATE TABLE service_providers (
    service_provider_id INT PRIMARY KEY,
    provider_name VARCHAR(50),
    provider_type VARCHAR(50),
    provider_rating FLOAT
);

CREATE TABLE revenue_streams (
    stream_id INT PRIMARY KEY,
    service_provider_id INT,
    income_amount FLOAT,
    income_date DATE
);

CREATE TABLE transaction_data ( transaction_id UUID PRIMARY KEY,
                   timestamp TIMESTAMP,
                   amount DECIMAL,
                   customer_id UUID,
                   delivery_service VARCHAR
);

CREATE TABLE customer_data ( customer_id UUID PRIMARY KEY,
                   name VARCHAR,
                   email VARCHAR,
                   phone_number VARCHAR,
                   total_transactions INT
);

CREATE TABLE revenue_data ( revenue_id UUID PRIMARY KEY,
                   timestamp TIMESTAMP,
                   amount DECIMAL,
                   revenue_type VARCHAR,
                   transaction_id UUID
);

CREATE TABLE delivery_service_info ( service_id UUID PRIMARY KEY,
                   service_name VARCHAR,
                   service_type VARCHAR,
                   delivery_location VARCHAR,
                   rating DECIMAL
);

CREATE TABLE transaction_history ( transaction_id UUID,
                   transaction_status VARCHAR,
                   delivery_service_id UUID,
                   timestamp TIMESTAMP,
                   PRIMARY KEY (transaction_id, delivery_service_id)
);
